import React from 'react';
import { Container, Row } from 'react-bootstrap';
import { Outlet } from "react-router-dom";
import Navigation from '../navigation/navigation';

const layout = (props) => {
    return (
        <>
        <Container>
            <Row>
            <Link to="/b">Blogs</Link>
            </Row>
            <main>
                {props.children}
            </main>
        </Container>
        <Outlet />
        </>
    )
}

export default layout;
